import React from 'react';
import styled from 'styled-components';

const CardBox = styled.div`
    width: 300px;
    height: 300px;
    background-color: red;
`

const Title = styled.h1`

`


function Card({title}) {
  return <CardBox>
      <Title></Title>
  </CardBox>;
}

export default Card;
